function test1(t) {
  var n = $("#formTester");
  if (((baconQ = n.find("input[name='baconQ']")), 0 == baconQ.length))
    return output("No variable found by the name of baconQ. Try again.", t), !1;
  var e = n.find("input[name='baconQ']");
  return 3 != e.length
    ? (output("There must be three inputs with the name BaconQ. Try again.", t),
      !1)
    : (e.each(function () {
        if ("radio" != $(this).attr("type"))
          return (
            output(
              "Incorrect input type for input named baconQ. Try again.",
              t
            ),
            !1
          );
      }),
      output(
        "<b>Question 1 Correct!</b> found 3 inputs named baconQ of type radio"
      ),
      addQ2(),
      !0);
}
function addQ2() {
  "none" == $("#q2Instructions").css("display") &&
    ($("#formQ").append("<option value='2'>Login form</option>"),
    $("#q2Instructions").css("display", "block"));
}
function test2(t) {
  var n = $("#formTester");
  console.log("test2");
  var e = n.find("input[name='username']"),
    o = n.find("input[name='password']");
  return 0 == e.length || "text" != e.attr("type")
    ? (output("Did not find an appropriate input for username. Try again.", t),
      !1)
    : 0 == o.length || "password" != o.attr("type")
    ? (output("Did not find an appropriate input for password. Try again.", t),
      !1)
    : (output(
        "<b>Question 2 Correct!</b> created a username and password input."
      ),
      addQ3(),
      !0);
}
function addQ3() {
  "none" == $("#q3Instructions").css("display") &&
    ($("#formQ").append("<option value='3'>Save Password?</option>"),
    $("#q3Instructions").css("display", "block"));
}
function test3(t) {
  var n = $("#formTester").find("input[name='saveUsername']");
  return 0 == n.length || "checkbox" != n.attr("type")
    ? (output(
        "Did not find an appropriate input for saveUsername. Try again.",
        t
      ),
      !1)
    : (output("<b>Question 3 Correct!</b> found saveUsername checkbox"),
      addQ4(),
      !0);
}
function addQ4() {
  "none" == $("#q4Instructions").css("display") &&
    ($("#formQ").append(
      "<option value='4'>Select your favorite game meat</option>"
    ),
    $("#q4Instructions").css("display", "block"));
}
function test4(t) {
  var n = $("#formTester").find("select[name='gameSelect']");
  return 0 == n.length
    ? (output(
        "Did not find an appropriate input for gameSelect. Try again.",
        t
      ),
      !1)
    : n.find("option").length < 4
    ? (output("Did not find 4 options within gameSelect. Try again.", t), !1)
    : (output(
        "<b>Question 4 Correct!</b> found four options for gameSelect select box"
      ),
      output("<img src='mission_accomplished.jpg' width='90%' />"),
      !0);
}
function output(t, n) {
  n || $("#outputWindow").html($("#outputWindow").html() + "\n" + t);
}
$(document).ready(function () {
  ($.urlParam = function (t) {
    var n = new RegExp("[?&]" + t + "=([^&#]*)").exec(window.location.href);
    return null == n ? null : decodeURI(n[1]) || 0;
  }),
    test1(!0) && test2(!0) && test3(!0),
    $("#answerBtn").click(function () {
      var t = parseInt($("#formQ").val());
      return (
        console.log(t),
        1 == t
          ? test1()
          : 2 == t
          ? test2()
          : 3 == t
          ? test3()
          : 4 == t && test4(),
        !1
      );
    });
});
